(4, 'Data Protection and Information Security', , 'dataprotection.jpg', 'Rreziqet e sigurisë së të dhënave dhe privatësisë janë vazhdimisht në rritje brenda strukturës së biznesit të shumë organizatave. Siguria e informacionit mundëson që të dhënat kritike të mbrohen nga qasja e paautorizuar dhe keqpërdorimi, si dhe të sigurojë të dhënat nga fshirja, vjedhja dhe infektimi me viruse të ndryshëm. Ky shërbim ndihmonë në standardizimin dhe automatizimin e sigurisë brenda proceseve duke ofruar autorizimin dhe autentifikimin e duhur, metodat efektive të enkriptimit, menaxhimin e fjalëkalimeve, rishikimin e procesit të ruajtjes dhe rikuperimit të të dhënave.', 'SIEM, Sophos, Egnyte, HashiCorp Vault, FortiGate, Symantec', 4);
INSERT INTO `umshs_sherbimet_sigurise` (`ID_Sherbimi`, `Emri_Sherbimit`, `Foto_Sherbimit`, `Emri_FotoSherbimit`, `Pershkrimi_Sherbimit`, `Veglat_Sherbimit`, `ID_Kategoria`) VALUES
(5, 'Malware Prevention', , 'malwareprevention.jpg', 'Malware i referohet çdo softueri ndërhyrës të zhvilluar nga kriminelët kibernetikë për të vjedhur të dhëna dhe për të dëmtuar ose shkatërruar kompjuterë dhe sisteme kompjuterike. Shembuj të malware të zakonshëm përfshijnë viruset, krimbat, viruset trojan, spyware, adware dhe ransomware. Ky shërbim mundëson zbulimin dhe parandalimin e malware dhe pasojave të tyre duke ofruar siguri gjithëpërfshirëse të aseteve softuerike dhe ambient të përshtatshëm për funksionimin efektiv të tyre.', 'Malwarebytes, Kaspersky, McAfee, Bitdefender, Avast, Norton', 2);
INSERT INTO `umshs_sherbimet_sigurise` (`ID_Sherbimi`, `Emri_Sherbimit`, `Foto_Sherbimit`, `Emri_FotoSherbimit`, `Pershkrimi_Sherbimit`, `Veglat_Sherbimit`, `ID_Kategoria`) VALUES
(6, 'Penetration Testing', , 'pentest.png', 'Një demonstrim praktik i skenarëve të mundshëm të sulmeve që i mundëson një testuesi të anashkalojë kontrollet e sigurisë në rrjetin kompjuterik dhe të marrë privilegje të larta në sisteme të rëndësishme. Ky shërbim ju ofron informacion mbi dobësitë ekzistuese, pasojat e shfrytëzimit të tyre, vlerëson efektivitetin e masave të sigurisë të zbatuara, dhe ju mundëson të planifikoni veprime të mëtejshme për të rregulluar defektet e zbuluara dhe për të përmirësuar sigurinë.', 'NMAP, Metasploit, WireShark, Acunetix, Nessus, Ettercap', 1);

